import MathComfort from "../assets/mathcomfort.png";

const Page3 = ({ progress }) => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        marginTop: "50px", // Adjust margin top as needed
      }}
    >
      <div style={{ width: "100%", textAlign: "center" }}>
        <div style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
          <img
            src={MathComfort}
            alt="Math Comfort"
            style={{
              marginBottom: "20px",
              maxWidth: "100%",
              height: "auto",
              width: "400px", // Default width for larger screens
            }}
          />
          <div style={{ textAlign: "left", maxWidth: "600px" }}>
            <h1 style={{ marginBottom: "10px" }}>You are in the right place</h1>
            <p>
              Description goes here. Lorem ipsum dolor sit amet, consectetur adipiscing elit.
              Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Page3;
